import styled from "styled-components";


export const Wrapper = styled.div `
    position: relative;
    min-height: 100vh;
    width: 100vw;
    height: 100vh;
    background: light blue;
    padding-bottom: 2.5rem;

`

export const Content = styled.div `

#content-wrap {
    padding-bottom: 2.5rem;    /* Footer height */
  }

`
